import { useEffect, useState } from 'react';
import React from 'react';
import '../Styles/CarManagement.css';

function CarManagement() {
    const [cars, setCars] = useState([]);
    const [newCar, setNewCar] = useState({
        model: '',
        kilometers: 0,
        price: 0,
        releaseDate: '',
        vehicleType: '',
        color: '',
        showroomName: '',
    });
    const [showAddForm, setShowAddForm] = useState(false);

    useEffect(() => {
        // Fetch existing cars from backend
        fetch("http://localhost:8080/api/car")
            .then(response => {
                if (!response.ok) {
                    throw new Error("Eroare la încărcarea datelor");
                }
                return response.json();
            })
            .then(data => setCars(data))
            .catch(error => console.error("Eroare:", error));
    }, []);

    // Add Car
    const handleAddCar = () => {
        fetch("http://localhost:8080/api/car", {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify(newCar),
        })
            .then(response => response.json())
            .then((addedCar) => {
                setCars([...cars, addedCar]);
                setNewCar({
                    model: '',
                    kilometers: 0,
                    price: 0,
                    releaseDate: '',
                    vehicleType: '',
                    color: '',
                    showroomName: '',
                });
                setShowAddForm(false); // Hide form after adding car
            })
            .catch(error => console.error("Eroare la adăugarea mașinii:", error));
    };

    return (
        <div>
            <h3>Management Mașini</h3>

            {/* Button to Show/Hide Add Car Form */}
            <div className="button-container">
                <button onClick={() => setShowAddForm(!showAddForm)}>
                    {showAddForm ? "Anulează Adăugarea" : "Adaugă Mașină"}
                </button>
            </div>

            {/* Add Car Form */}
            {showAddForm && (
                <div>
                    <h4>Adaugă o Mașină</h4>
                    <input
                        type="text"
                        placeholder="Model"
                        value={newCar.model}
                        onChange={(e) => setNewCar({ ...newCar, model: e.target.value })}
                    />
                    <input
                        type="number"
                        placeholder="Kilometri"
                        value={newCar.kilometers}
                        onChange={(e) => setNewCar({ ...newCar, kilometers: parseInt(e.target.value) })}
                    />
                    <input
                        type="number"
                        placeholder="Preț"
                        value={newCar.price}
                        onChange={(e) => setNewCar({ ...newCar, price: parseInt(e.target.value) })}
                    />
                    <input
                        type="date"
                        placeholder="Anul Fabricării"
                        value={newCar.releaseDate}
                        onChange={(e) => setNewCar({ ...newCar, releaseDate: e.target.value })}
                    />
                    <input
                        type="text"
                        placeholder="Tip Vehicul"
                        value={newCar.vehicleType}
                        onChange={(e) => setNewCar({ ...newCar, vehicleType: e.target.value })}
                    />
                    <input
                        type="text"
                        placeholder="Culoare"
                        value={newCar.color}
                        onChange={(e) => setNewCar({ ...newCar, color: e.target.value })}
                    />
                    <input
                        type="text"
                        placeholder="Numele Showroom-ului"
                        value={newCar.showroomName}
                        onChange={(e) => setNewCar({ ...newCar, showroomName: e.target.value })}
                    />
                    <button onClick={handleAddCar}>Adaugă Mașină</button>
                </div>
            )}

            {/* Car List */}
            <div className="car-list">
                {cars.length > 0 ? (
                    cars.map((car) => (
                        <div key={car.idCar} className="car-item">
                            <p><strong>Model:</strong> {car.model}</p>
                            <p><strong>Kilometri:</strong> {car.kilometers}</p>
                            <p><strong>Preț:</strong> {car.price}</p>
                            <p><strong>Anul Fabricării:</strong> {car.releaseDate}</p>
                            <p><strong>Tip Vehicul:</strong> {car.vehicleType}</p>
                            <p><strong>Culoare:</strong> {car.color}</p>
                            <p><strong>Showroom:</strong> {car.showroomName}</p>
                        </div>
                    ))
                ) : (
                    <p>Nu există mașini disponibile.</p>
                )}
            </div>
        </div>
    );
}

export default CarManagement;
